import React, { Component } from 'react';
import {Helmet} from 'react-helmet';

import Fetchers from './utilities/fetchers.js';


// import Router from './utilities/router.js';
// import OuterHeader from './components/outer-header.js';

const App = () =>
      <div className="ma3 mw7">
        <Helmet>
          <meta charSet="utf-8" />
          <title>MMW</title>
        </Helmet>
        <h1>hi</h1>

        {/* <OuterHeader/> */}
        {/* <Router/> */}
      </div>; 


export default App;







class ProfilesListView extends Component {

    constructor(props) {
        super(props);

        this.state = {};
        this.title = "All Posts";

        this.fetchData = Fetchers.fetchData.bind(this);        
        this.fetchMoreData = Fetchers.fetchMoreData.bind(this);

    }

    componentDidMount() {
        this.fetchData();
    }

    render() {
        const {latest_posts,
               more,
              }
              = this.state;
        if (!latest_posts) {
            return "loading...";
        }
        return (
            <div className="page">
              <Helmet>
                <meta charSet="utf-8" />
                <title>MMW - {this.title}</title>
              </Helmet>
              <hr/>
              <div className="cf fl">
                <div className="fl w-90 pr2 justify-center">
                  <ExtendingList
                    headingStr="Latest posts"
                    contentsList={latest_posts}
                    itemRenderer={PostPreview}
                    extender={() =>
                              this.fetchMoreData('latest_posts', 10)
                             }
                    more={more}
                  />
                </div>
              </div>
            </div>
        );
    }
}
